import "../index.css"


const WeatherData = ({selectedItem})=>{
    //console.log(selectedItem)
    return <div className="picture">
        <p>1234 </p>
        {
            selectedItem && selectedItem.map((item)=>{
                return(
                    <div>
                        {item.DayHumidity} {item.WindSpeed}
                    </div>
                )
            })
        }
    </div>
       
}

export default WeatherData;
